import React, { useState } from "react";
import { useForm } from "react-hook-form";


const Formwithhook = () =>{
    const [userInfo, setUserinfo] = useState()
    const {register, handleSubmit, errors} = useForm() 
    const onSubmit = (data) => {
        setUserinfo(data )
        console.log(data)
    }
    return(
        <div>
        <h2>Form with form-hook library</h2>
        <pre>{JSON.stringify(userInfo, undefined, 2)}</pre>
        <form onSubmit={handleSubmit(onSubmit)}>
            <div>
            <label>username: </label>
            <input type="text" name="username" placeholder="username" ref={register}></input>
            </div>
            <div>
            <label>email: </label>
            <input type="text" name="email" placeholder="email" ref={register}></input>
            </div>
            <div>
            <label>password: </label>
            <input type="password" name="password" placeholder="password" ref={register}></input>
            </div>
            <button type="button" >Register</button>
        </form>
        </div>
    )
}
export default Formwithhook;
